function transfer(address recipient, uint256 amount) public payable returns (bool) {
    address sender = _msgSender();

    // Basic zero-address checks (present in original bytecode)
    require(sender != address(0), "ERC20: transfer from the zero address");
    require(recipient != address(0), "ERC20: transfer to the zero address");

    // Balance check
    require(amount <= _balances[sender], "ERC20: transfer amount exceeds balance");

    /*
     * Fee calculations
     *
     *  totalFee       = (_txFee + _burnFee) %
     *  feeToAddress   =  _txFee            %
     *  feeToBurn      =  _burnFee          %
     *
     *  All fee math is performed exactly as in the original byte-code:
     *      fee = amount * feeRate / 100
     */
    uint256 feeToAddress = (amount * _txFee) / 100;
    uint256 feeToBurn    = (amount * _burnFee) / 100;
    uint256 totalFee     = feeToAddress + feeToBurn;
    uint256 amountAfterFee = amount - totalFee;

    // State updates: sender balance
    _balances[sender] -= amount;

    // State updates: recipient balance
    _balances[recipient] += amountAfterFee;
    emit Transfer(sender, recipient, amountAfterFee);

    // State updates: fee receiver balance
    if (feeToAddress > 0) {
        _balances[_FeeAddress] += feeToAddress;
        emit Transfer(sender, _FeeAddress, feeToAddress);
    }

    // State updates: burn (reduce total supply)
    if (feeToBurn > 0) {
        _totalSupply -= feeToBurn;
        emit Transfer(sender, address(0), feeToBurn);
    }

    return true;
}

